Ok so the periodic boundary conditions are not currently supported in the Control system.
They inherit very fast from libmesh periodic boundary conditions, they dont have most of the moose wrapping the regular BCs have. The [Periodic] action creates them, they are not regular moose objects.
@andrsd how much work would think adding them to the control system would be? Do we have anyone working on periodic BCs rn who could take a look?

